import React from "react";
import {
  Card,
  CardHeader,
  CardMedia,
  CardContent,
  Typography,
  CardActions,
  Button,
  Grid
} from "@material-ui/core";
import { makeStyles } from '@material-ui/core/styles';
import {ArrowUpwardRoundedIcon, ArrowDownwardRoundedIcon} from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
  memCard: {

    'margin-left': '20%',
    'margin-top': '5%',
    'margin-bottom': '5%',
    width: "60%",
  }
})
);

const Mem = ({mem}) => {
  const classes = useStyles();
  return (
    <div>

      <Card className={classes.memCard}>
      <CardHeader title=  {mem.title}/>
      <img src={mem.img} alt={mem.title} style={{width: 300}}/>
        {/* <CardMedia

          style={{
            height: 0,
            paddingTop: '56.25%',
          }}
          image={mem.img}
          title={mem.title}
          className="mem-img"
        /> */}
        <CardActions>
          <Grid>
          <Button size="small" color="primary">
          <ArrowUpwardRoundedIcon/>
           {mem.upvotes}
          </Button>
          <Button size="small" color="primary">
            <ArrowDownwardRoundedIcon/>
           {mem.downvotes}
          </Button>
          </Grid>
        </CardActions>
      </Card>
    </div>
  );
};

export default Mem;
